const tagElement = document.getElementById("tag");

Object.entries(tags).forEach(([tagName, { title }]) => {
  const el = document.createElement("option");
  el.value = tagName;
  el.innerHTML = title;
  tagElement.appendChild(el);
});

function generate(event) {
  event.preventDefault();

  const {
    tag: { value: tag },
    ...formElements
  } = event.target.elements;

  const { svg: tagSvgModel } = tags[tag];

  const finalTagSvg = Object.values(formElements).reduce(
    (finalSvg, formElement) =>
      finalSvg.replace(`{{${formElement.name}}}`, formElement.value),
    tagSvgModel
  );

  svgToPng(finalTagSvg, (imgData) => {
    downloadFile(tag, imgData);
  });
}

function downloadFile(name, path) {
  const link = document.createElement("a");
  link.href = path;
  link.download = name;
  link.click();
}

function svgToPng(svg, callback) {
  const url = getSvgUrl(svg);
  svgUrlToPng(url, (imgData) => {
    callback(imgData);
    URL.revokeObjectURL(url);
  });
}

function getSvgUrl(svg) {
  return URL.createObjectURL(
    new Blob([svg], {
      type: "image/svg+xml",
    })
  );
}

function svgUrlToPng(svgUrl, callback) {
  const svgImage = new Image();

  svgImage.style.opacity = "0";
  document.body.appendChild(svgImage);

  svgImage.addEventListener("load", () => {
    const canvas = document.createElement("canvas");
    canvas.width = svgImage.clientWidth;
    canvas.height = svgImage.clientHeight;
    const canvasCtx = canvas.getContext("2d");
    canvasCtx.drawImage(svgImage, 0, 0);
    document.body.removeChild(svgImage);
    const imgData = canvas.toDataURL("image/png");
    callback(imgData);
  });

  svgImage.src = svgUrl;
}
